import React from 'react';
import './FooterBottom.css';

function FooterBottom() {
  return (
     <>
        <div className='footerbottom'>
            <div className='footerbottom-bordertop'></div>
            <div className='footerbottom-container'>
                <div className='footerbottom-conteudo'>
                    <div className='footerbottom-conteudo-divleft'></div>
                    <div className='footerbottom-conteudo-divcenter'></div>
                    <div className='footerbottom-conteudo-divright'></div>
                </div>
            </div>
        </div>
     </>
    );
}

export default FooterBottom;
